TableData.TableDescription:
This is the initial threshold level for the knock sensors.
The knock sensor threshold values are learned, based on previous knock sensor values. Each knock sensor learns its own unique threshold. The learned thresholds are multiplied by two multipliers (determined by operating conditions). The average background noise is then added to determine the calculated thresholds. The calculated thresholds are compared with their respective knock sensor voltage levels. If a knock sensor's voltage level is below its calculated threshold then that knock sensor's signal is ignored.
This value is used for both knock sensors. See also: {-B6241}{-B6242}

This is the minimum learned threshold level for the knock sensors.
This value is used for both knock sensors.
See also: {-B6240}

This is the maximum learned threshold level for the knock sensors.
This value is used for both knock sensors.
See also: {-B6240}

The average background noise cannot go below this value.
Setting this value too high will "deafen" the knock sensors under all operating conditions.
See also: {-B6248}

Determines whether knock detection is done per cylinder or per engine.

If this value is set (Cylinder Mode), then the following knock threshold multiplier tables are used:
